import React from 'react';
import "../styles/adddata.css"
import Charadata from './/Charadata';
import {Routes, Route, useNavigate} from 'react-router-dom';
// import '../styles/home.css'

function Adddata() {
  const navigate = useNavigate();

  function msg(){
    <a href="Charadata.js"></a>
  }

  return (
    <div className='adddata'>
        <h1>Which of the following do you wish to update?</h1>
        <button class="chara"><a href="Charadata.js">Characters</a></button>
        <input type="button" value="Character" onclick="msg()"></input>
        {/* <button onClick={sayHello}>Character Ascension Materials</button>;
        <button onClick={sayHello}>Character Information</button>;
        <button onClick={sayHello}>Regions</button>;
        <button onClick={sayHello}>Relations</button>;
        <button onClick={sayHello}>Talents</button>;
        <button onClick={sayHello}>Weapons</button>;
        <button onClick={sayHello}>Weapon Domain</button>; */}
    </div>
  );
}

export default Adddata
